export default {
	siteChange: (siteId) => {
		if (!_.isEmpty(siteId)){
			GetSiteWorkCenters.run()
		}
	},
	workCenterChange: (equipmentId) => {
		if (!_.isEmpty(equipmentId)){
			GetSiteWorkStations.run()
		}
	},
	workCellChange: (equipmentId) => {
		if (!_.isEmpty(equipmentId)){
			GetEquipmentJobOrders.run()
		}
	}
}
